import React, { Component } from 'react';

class EndGame extends Component {
    render() {
        return (
            this.props.win === "win" ?
                <div> Congradulations </div> :
                <div> Oish. You Lost. The secret word was: {this.props.word} </div>
        );
    }
}

export default EndGame;
